if mibBuilder.loadTexts: ciscoWirelessDocsIfMib.setDescription('This is the MIB Module for MCNS compliant Radio Frequency (RF) interfaces in wireless point-to-multipoint subscriber units (SU) and wireless Head-end (HE). Glossary : The following terms are used in the MIB definitions below. MCNS : Multimedia Cable Network System P2MP : Point-Multipoint wireless system consisting of Headend (HE) and Subscriber-units (SU). HE : Head-end SU : Subscriber-unit. Attached US channel : The upstream channel on which the SU is transmitting. codeword : Data unit in a FEC (forward error correction) process. OFDM : Orthogonal Frequency Division Multiplexing. ODU : Outdoor unit (antenna). UCD : Upstream Change Descriptor. Cisco Wireless DOCSIS MIB Organization: The Cisco Wireless DOCSIS MIB provides the following categories : * Groups/Tables that are common between HE and SU * Groups/Tables that apply to SU only * Groups/Tables that apply to HE only Groups/Tables that are common between HE and SU o. cwdIfChannelTable This represents the RF channel within which upstream and downstream sub-channels operate. There will one such RF channel per point-to-multipoint interface. A RF channel identifies the portion of the RF spectrum that will be used to create a broadcast domain that will be used for communication. This channel deploys a sub-channel plan, which is used by the upstreams and downstreams. The sub-channel number for a channel is determined based on the number of sub-channels allowed and sub-channel plan version. If the maximum number of sub-channels allowed is 4 and the sub-channel plan version is 1 the spectrum can be sub divided as shown below. reference center frequency of a channel | | v +===============+ | sub 1 | The whole spectrum is used +=======+=======+ so only one sub-channel. +===============+ | 2 | 3 | The spectrum is divided into +===============+ two sub-channels. +===============+ | 2 | 6 | 7 | The spectrum is divided into +===============+ three sub-channels. +===============+ | 4 | 5 | 3 | The spectrum is divided into +===============+ three sub-channels. +===+===+===+===+ | 4 | 5 | 6 | 7 | The spectrum is divided into +===+===+===+===+ 4 sub-channels The above sub-channel planning can be extended to allow maximum number of sub-channels to be 8, 26 etc. The objects in this group are configurable only at the head-end and are read-only at the subscriber end. o. cwdIfDownstreamChannelTable This table contains the configuration information and attributes of downstream channel. The objects in this group are configurable only at the head-end and are read-only at the subscriber end. o. cwdIfUpstreamChannelTable This table contains the configuration information and attributes of upstream channel. Parameters in this table are configurable only at the Head-end, and are read-only at the SU. Only the rows that pertain to the upstream used by the subscriber unit will be available at the SU. o. cwdIfQosProfileTable This table describes the attributes of each class of service. The entries in this table are referenced from the cwdIfHeServiceEntries or cwdIfSuServiceEntries. This table is implemented at both the SU and the HE. The SU need only maintain entries for the classes of service referenced by its cwdIfSuServiceTable. o. cwdIfSignalQualityTable At the SU, this table describes the PHY signal quality of downstream channels. At the HE, it describes the PHY signal quality of upstream channels. o. cwdIfModulationTable Describes modulation parameters associated with one or more Upstream or downstream channels. Groups/Tables that apply to SU only o. cwdIfSuMacTable This table describes the attributes of each SU MAC interface, extending the information available from ifEntry. An entry in this table exists for each ifEntry with an ifType of propDocsWirelessMacLayer(nnn). o. cwdIfSuStatusTable This table maintains a number of status objects and counters for Subscriber Units. An entry in this table exists for each ifEntry with an ifType of propDocsWirelessMacLayer(nnn). o. cwdIfSuServiceTable This table describes the attributes of each upstream service queue on a SU. Groups/Tables that apply to HE only o. cwdIfHeMacTable Describes the attributes of each HE MAC interface, extending the information available from ifEntry. An entry in this table exists for each ifEntry with an ifType of propDocsWirelessMacLayer(nnn). o. cwdIfHeStatusTable For the MAC layer, this group maintains a number of status objects and counters. An entry in this table exists for each ifEntry with an ifType of propDocsWirelessMacLayer(nnn). o. cwdIfHeServiceTable This table describes the attributes of upstream service queues in a Head-end System. Entries in this table exist for each ifEntry with an ifType of propDocsWirelessMacLayer(nnn), and for each service queue (Service ID) within this MAC layer. Entries in this table are created with the creation of individual Service IDs by the MAC layer and removed when a Service ID is removed.')
